	public static void main(String[] args){
		label();
		checkHole();
	}
	
	static int width = 128;
	static int height = 128;
	static int depth = 1;
	static int[] mask;	
	static HashMap<Integer, Integer> hashPix;
	public static void label(){
		mask = new int[height * width];
		
		int num = 1;
		hashPix = new HashMap<Integer,Integer>();
		for(int i = 0 ; i < height; i++){
			for(int j = 0 ; j < width; j++){
				if(mask[i*width +j] ==0){
					hashPix.put(num, m[i*width +j]);
					recurs(i,j,0,num++,mask);
				}
			}
		}
		
		
		for(int i = 0 ; i < height ; i++){
			for(int j = 0 ; j < width ; j++){
				System.out.print(mask[i * width  + j]+" ");				
			}
			System.out.println();
		}
		
		System.out.println(hashPix.toString());
	}
	
	public static void checkHole(){
		for(Entry<Integer, Integer> e : hashPix.entrySet()){
			if(!e.getKey().equals(1) && e.getValue().equals(0))
				fillHole((Integer)e.getKey());
		}
	}
	
	public static void fillHole(int index){
		int w = 0,h = 0,d = 0;
		for(int i = 0 ; i < height; i++){
			for(int j = 0 ; j < width; j++){
				if(mask[i*width +j] == index){
					w = j; h = i; d=0;
					break;
				}
			}
		}
		int replacingVal = checkAdjacents(w,h,d);
		recurs(w,h,d,replacingVal,m);
		
		for(int i = 0 ; i < height ; i++){
			for(int j = 0 ; j < width ; j++){
				System.out.print(m[i * width  + j]+" ");				
			}
			System.out.println();
		}
		
		System.out.println(hashPix.toString());
	}
	
	public static int checkAdjacents(int i, int j, int d){
		int max = 0;
		
		Stack<Integer> block = new Stack<Integer>();
		block.push(i);
		block.push(j);
		block.push(d);

		
		while(!block.isEmpty()){
			d = block.pop();
			j = block.pop();
			i = block.pop();
			mask[d * height * width + i * width + j] = 0;
			//check right
			if(j != width - 1 && m[d * height * width + i * width + j + 1] == 0 && mask[d * height * width + i * width + j + 1] != 0){
				block.push(i);
				block.push(j+1);
				block.push(d);
			}

			if(m[d * height * width + i * width + j + 1] > max)
				max = m[d * height * width + i * width + j + 1];
			
			//check left
			if(j != 0 && m[d * height * width + i * width + j - 1] == 0 && mask[d * height * width + i * width + j - 1] != 0){
				block.push(i);
				block.push(j-1);
				block.push(d);
			}
			
			if(m[d * height * width + i * width + j - 1] > max)
				max = m[d * height * width + i * width + j - 1];
			
			//check down
			if(i != height - 1 && m[d * height * width + (i+1) * width + j ] == 0 && mask[d * height * width + (i+1) * width + j] != 0){
				block.push(i+1);
				block.push(j);
				block.push(d);
			}
			
			if(m[d * height * width + (i+1) * width + j ] > max)
				max = m[d * height * width + (i+1) * width + j];
			
			//check up
			if(i != 0 && m[d * height * width + (i-1) * width + j] == 0 && mask[d * height * width + (i-1) * width + j] != 0){
				block.push(i-1);
				block.push(j);
				block.push(d);
			}
			
			if(m[d * height * width + (i-1) * width + j ] > max)
				max = m[d * height * width + (i-1) * width + j ];
			
			//check above
			if(d != depth - 1 && m[(d+1) * height * width + i * width + j] == 0 && mask[(d+1) * height * width + i * width + j] != 0){
				block.push(i);
				block.push(j);
				block.push(d+1);
			}
			
			if(d != depth - 1 && m[(d+1) * height * width + i * width + j] > max)
				max = m[(d+1) * height * width + i * width + j];
			
			//check below
			if(d != 0 && m[(d-1) * height * width + i * width + j] == 0 && mask[(d-1) * height * width + i * width + j] != 0){
				block.push(i);
				block.push(j);
				block.push(d-1);
			}
			
			if(d != 0 && m[(d-1) * height * width + i * width + j] > max)
				max = m[(d- 1) * height * width + i * width + j];
			
		}
		
		
		return max;	
	}
	
	private static void recurs(int i , int j, int d, final int val, int[] x){
    	Stack<Integer> block = new Stack<Integer>();
		block.push(i);
		block.push(j);
		block.push(d);

		
		while(!block.isEmpty()){
			d = block.pop();
			j = block.pop();
			i = block.pop();
			
			//check right
			if(j != width - 1 && x[d * height * width + i * width + j + 1] == 0 && m[d * height * width + i * width + j + 1] == m[d * height * width + i * width + j]){
				block.push(i);
				block.push(j+1);
				block.push(d);
			}

			//check left
			if(j != 0 && x[d * height * width + i * width + j - 1] == 0 && m[d * height * width + i * width + j - 1] == m[d * height * width + i * width + j]){
				block.push(i);
				block.push(j-1);
				block.push(d);
			}

			//check down
			if(i != height - 1 && x[d * height * width + (i+1) * width + j ] == 0 && m[d * height * width + (i+1) * width + j] == m[d * height * width + i * width + j]){
				block.push(i+1);
				block.push(j);
				block.push(d);
			}

			//check up
			if(i != 0 && x[d * height * width + (i-1) * width + j] == 0 && m[d * height * width + (i-1) * width + j] == m[d * height * width + i * width + j]){
				block.push(i-1);
				block.push(j);
				block.push(d);
			}
			
			//check above
			if(d != depth - 1 && x[(d+1) * height * width + i * width + j] == 0 && m[(d+1) * height * width + i * width + j] == m[d * height * width + i * width + j]){
				block.push(i);
				block.push(j);
				block.push(d+1);
			}
			
			//check below
			if(d != 0 && x[(d-1) * height * width + i * width + j] == 0 && m[(d-1) * height * width + i * width + j] == m[d * height * width + i * width + j]){
				block.push(i);
				block.push(j);
				block.push(d-1);
			}
			x[d * height * width + i * width + j] = val;

		}
    }

